window.bookSummaryJSON = "<p><b>Flicka won’t allow herself to be terrified.</b></p> <p>She’s on the run from her cheating, soon-to-be ex-husband Prince Pierre and his Secret Service, and she doesn’t have a passport, credit cards, or money. She needs to get to Paris to talk to her lawyers about divorcing that bastard.</p> <p>The only thing standing between her and the cheating prince is Dieter Schwarz, her bodyguard, her protector, and her ex-lover. He’s six feet, four inches of sarcasm, dark humor, and rock-hard muscle. A former Swiss mercenary, now he owns and operates Rogue Security - a band of former special operations soldiers, SEALs, hackers, and spies - which will take any dirty covert operation for the right price.</p> <p>But the Secret Service is tracking her, and even Dieter and the Rogues might not be able to keep her safe from her ex.</p> <p>And once again, she’s falling in love with Dieter, which might be the most dangerous thing of all.</p>"; 
